row.EN-Gloss:
lacking physical depth; having little spatial extension downward or inward from an outer surface or backward or outward from a center;
    "shallow water"; "a shallow dish"; "a shallow cut"; "a shallow closet"; "established a shallow beachhead"; "hit the ball to shallow left
    field"

filled with melancholy and despondency ; "gloomy at the thought of what he had to face"; "gloomy predictions"; "a gloomy silence";
    "took a grim view of the economy"; "the darkening mood"; "lonely and blue in a strange city"; "depressed by the loss of his job"; "a dispirited
    and resigned expression on her face"; "downcast after his defeat"; "feeling discouraged and downhearted"

roundabout and unnecessarily wordy; "had a preference for circumlocutious (or circumlocutory) rather than forthright expression"; "A
    periphrastic study in a worn-out poetical fashion,/ Leaving one still with the intolerable wrestle/ With words and meanings."-T.S.Eliot;
    (`ambagious' is archaic)
